import React from "react";
import {Link} from "react-router-dom"

function Navbar() {
  return (
    <nav className="nav">
     
      <h2><Link to="/">DL Shop</Link></h2>
      <ul>
        <li><Link to="/profile">Profile</Link></li>
        <li><Link to="/product">Wishlist</Link></li>
        <li>Bag</li>
      </ul>
    </nav>
  );
}

export default Navbar;
